import { io } from 'socket.io-client';
import { useEffect, useState } from 'react';



function App() {

  const {
    data,
    isLoading,
    isSuccess,
    isError,
    error
  } = useGetStocksQuery()

  if (isLoading) {
    console.log('Loading...')
  } else if (isSuccess) {
    console.log(data.flat())
  } else if (isError) {
    console.log(error);
  }

  return (
    <div>
      <button>Start!</button>
    </div>
  );
}

